import { Navbar, Nav } from 'react-bootstrap';

const Navigation = () => {
    return (
        <Navbar fixed='top' expand="lg" bg="dark">
            <Nav>
                <Nav.Link>Home</Nav.Link>
                <Nav.Link>Page</Nav.Link>
            </Nav>
        </Navbar>
    )
}



export default Navigation;
